import { Col, Row } from "react-bootstrap";
import * as Icon from "react-bootstrap-icons";

const Chat = () => {
  return (
    <Col>
      <Row className="mt-3">
        <div className="inputContainer">
          <Icon.Search className="search-icon" size={20} />
          <input
            type="search"
            placeholder="search"
            className="w-100 pr-1 pl-5 py-2 mr-3 search-field"
          />
        </div>
      </Row>
    </Col>
  );
};
export default Chat;
